import React from "react";
import "./style.css";
import { Container, Row, Col, Card, Button } from "react-bootstrap";

const Home = () => {
  return (
    <>
      <div id="webpage">
        <div id="webpage_body">
          <Container className="home_container">
            <p>Hi, my name is</p>
            <h1>Sayaib Sarkar</h1>
            <h1>I build things for the web.</h1>
          </Container>
        </div>
      </div>
    </>
  );
};
export default Home;
